#include <cstdio> 
using namespace std; 
 
class  DigitHoles 
{ 
      public:  
      int numHoles(int n) 
            
             { 
                int i,ans=0; 
                 
                if (n==0)  { ans=1; } 
                 
                else { 
                 while (n>0) 
                 { 
                   i=n%10; 
                    if (i==8) ans=ans+2; 
                    if (i==4 || i==6 || i==0 || i==9) ans=ans+1; 
                    n=n/10; 
                 } } 
                  
              return ans; 
              
                } 
      };

